import React from 'react';
import './Sidebar.scss'

const Sidebar = () => {
    return (
        <div className='sidebar'>
            <div className='top'>
                <span className='logo'>Admin Panel </span>
            </div>
            <div className='center'>
                <ul>
                    <li>
                        <span>Dashboard</span>
                    </li>
                </ul>
            </div>
            <div className='bottom'></div>
        </div>
    );
};

export default Sidebar;
